INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(1, '1. Saque por Baixo', 'Fique de pé com os pés afastados na largura dos ombros, uma perna ligeiramente à frente da outra. Segure a bola com a mão não dominante (por exemplo, se você for destro, segure a bola com a mão esquerda). O braço que não está segurando a bola deve estar ao lado do corpo, ligeiramente flexionado, pronto para realizar o movimento de saque. Incline-se levemente para frente, flexionando os joelhos para ter um bom equilíbrio e uma base firme. Mantenha o braço que vai golpear a bola estendido para trás. Existe algumas formas de lançar a bola, uma delas é fechando a mão e cerrando o punho, e em seguida, gire o braço para que os dedos fechados e a parte interna do pulso fiquem voltados para cima, ou também você pode virar o punho para o lado, direcionando-o para dentro, e deixando o polegar voltado para cima. Imagine seu punho batendo na bola e seguindo uma linha até o ponto da quadra onde quer que ela caia. Ao contrário do saque por cima, a bola não é lançada no ar. Em vez disso, a bola é segurada próxima ao quadril da perna que está à frente. Certifique-se de que a bola esteja a uma altura confortável para ser golpeada. Leve o braço que vai golpear a bola para frente em um movimento de pêndulo. Ao golpear a bola, mantendo o braço estendido e firme. Golpeie a parte inferior da bola com força e precisão, tentando manter a bola baixa e direcionada ao campo adversário. Após o impacto, o braço deve continuar o movimento natural para cima, seguindo a trajetória da bola. Concentre-se em manter a bola dentro dos limites da quadra, direcionando-a para áreas que possam dificultar a recepção do adversário.', );
INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(2, '2. Saque por Cima', 'Fique de pé, com os pés afastados na largura dos ombros, uma perna um pouco à frente da outra para garantir estabilidade.\r\nSegure a bola com a mão oposta à que você vai sacar. Por exemplo, se for destro, segure a bola com a mão esquerda. Lance a bola levemente para cima, cerca de 30 a 60 cm acima da sua cabeça, mantendo o lançamento alinhado com o braço de ataque.\r\nO lançamento deve ser controlado e consistente, garantindo que a bola fique na trajetória ideal para o saque. Simultaneamente ao lançamento, o braço que vai realizar o saque deve ser levado para trás, com o cotovelo flexionado, preparando-se para golpear a bola.\r\nAo iniciar o movimento de saque, estenda o braço rapidamente em direção à bola, utilizando o peso do corpo para dar mais força ao movimento. Bata na bola com a parte superior da mão (a base dos dedos) ou com a palma, dependendo do tipo de saque que você deseja realizar.\r\nO braço deve estar completamente estendido no momento do impacto, e a bola deve ser atingida no ponto mais alto do movimento para garantir potência e precisão. Após o impacto, o braço deve continuar o movimento natural para frente, completando o gesto do saque.\r\nAo mesmo tempo, o peso do corpo deve ser transferido para a perna que estava atrás, ajudando no equilíbrio e na potência do saque.', );
INSERT INTO `fundamentos` (`id_fundamentos`, `titulo_fundamento`, `descricao`, `imagem_fundamento`) VALUES
(3, '3. Saque Viagem', 'Fique de pé atrás da linha de fundo, com os pés afastados na largura dos ombros.\r\nSegure a bola com a mão oposta à que você usará para sacar. Por exemplo, se você for destro, segure a bola com a mão esquerda. Lance a bola à frente de você e um pouco para cima, na direção onde você deseja sacar. O lançamento deve ser alto o suficiente para que você consiga realizar o saque no ponto mais alto do seu salto.\r\nO lançamento precisa ser preciso para que a bola caia diretamente na trajetória do seu braço durante o salto. Após lançar a bola, dê alguns passos rápidos para frente (normalmente três passos: dois pequenos e o terceiro mais longo) para ganhar impulso.\r\nNo último passo, concentre a força no pé de apoio e faça um salto explosivo, elevando-se o mais alto possível. Enquanto você salta, leve o braço que vai realizar o saque para trás, com o cotovelo flexionado.\r\nNo ponto mais alto do seu salto, estenda o braço rapidamente e golpeie a bola com a parte superior da mão, usando um movimento forte e controlado.\r\nO impacto deve ser feito com a mão aberta, e você deve bater na bola no ponto mais alto possível, colocando força e direcionando a bola com precisão. Após o impacto, o braço deve continuar o movimento natural para baixo.\r\nO corpo deve seguir o movimento, com os pés aterrissando suavemente e o peso do corpo transferido para a frente.\r\nO objetivo é que a bola viaje rapidamente em direção ao campo adversário, com uma trajetória descendente e alta velocidade, dificultando a recepção.', );

